import React from 'react';
import { Diff, Hunk, parseDiff } from 'react-diff-view';
import 'react-diff-view/style/index.css';

// Example old and new code snippets
const oldCode = `
function MyComponent() {
  return <div>Hello, old world!</div>;
}
`;

const newCode = `
function MyComponent() {
  return <div>Hello, new world!</div>;
}
`;

// Function to generate Unified Diff format text
const generateDiffText = (oldCode, newCode) => {
  return `
--- oldCode
+++ newCode
@@ -1,5 +1,5 @@
${oldCode.trim()}
---
${newCode.trim()}
`;
};

const DiffViewer = () => {
  const diffText = generateDiffText(oldCode, newCode);
  const [diff, error] = parseDiff(diffText);

  if (error) {
    console.error('Error parsing diff:', error);
    return <div>Error parsing diff</div>;
  }

  if (!diff || !diff.hunks) {
    return <div>Failed to parse diff</div>;
  }

  return (
    <Diff viewType="split" diff={diff}>
      {hunks => (diff.hunks || []).map(hunk => (
        <Hunk key={hunk.content} hunk={hunk} />
      ))}
    </Diff>
  );
};

const App = () => {
  return (
    <div className="App">
      <h1>Code Difference Viewer</h1>
      <DiffViewer />
    </div>
  );
};

export default App;
